import React from 'react';
import ReactDOM from 'react-dom';


class Compiler extends React.Component {
    constructor() {
        super()
        this.state = {
            nama: 'Ramad',
        }
    }

    render() {
        return (
            <div>
                <h1>Test</h1>
            </div>
        )
    }

}




ReactDOM.render(<Compiler />, document.getElementById('app'))
